    var g = svg.append("g").attr('transform', 'translate(' + margin.left + ',' + margin.right + ')');

    var tree = d3.tree()
        .size([height - margin.top - margin.bottom, width - margin.left - margin.right]);

    var link = g.selectAll(".link")
