function SendMessage(tag, msgTag, msg) {
    var sendObj = {
        "Tag": tag
    };
    sendObj[msgTag] = msg;
    (sendObj);
    (ComPort);
    try {
    ComPort.postMessage(sendObj);
    } catch (e) {
        //console.log("error");
    }

}


